import React, { Component } from 'react';
import { connect } from 'react-redux'
import { Link } from 'react-router-dom'
import { removeItem,addQuantity,subtractQuantity} from './actions/cartActions'
import Recipe from './Recipe'
class Cart extends Component{

    //to remove the item completely
    handleRemove = (id)=>{
        this.props.removeItem(id);
    }
    //to add the quantity
    handleAddQuantity = (id)=>{
        this.props.addQuantity(id);
    }
    //to substruct from the quantity
    handleSubtractQuantity = (id)=>{
        this.props.subtractQuantity(id);
    }
    render(){
         let newTotal = this.props.items.reduce(function (total, currentValue) {
    return total + currentValue.priceLabel;
},0);   
        let addedItems = this.props.items.length ?
            (  
                this.props.items.map(item=>{
                    return(
                       
                        <li className="collection-item avatark" key={item.id}>
                                    <div className="item-desc">
                                        <div className="row">
                                              <div className="column-labels ls-reset flex flex-middle">
                                            <div className="title">{item.title}</div>
                                            <Link to="/cart"><svg onClick={()=>{this.handleSubtractQuantity(item.id)}} width="24" height="24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" class="current-stroke c-blue c-pointer"><circle cx="12" cy="12" r="10"></circle><path d="M8 12h8"></path></svg></Link>
                                            <li className="addcart"><input type="text" value={item.quantity} min="1" className="productquantity"/></li>
                                            <Link to="/cart"><svg onClick={()=>{this.handleAddQuantity(item.id)}} width="24" height="24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" class="current-stroke c-blue c-pointer"><circle cx="12" cy="12" r="10"></circle><path d="M12 8v8M8 12h8"></path></svg></Link>
                                            <b>${item.priceLabel}/mo</b>
                                            <button className="waves-effect waves-light btn pink remove" onClick={()=>{this.handleRemove(item.id)}}>Remove</button>
                                            </div>
                                        </div>
                                        
                                    </div>
                                    
                                </li>
                         
                    )
                })
            ):

             (
                <p>Nothing.</p>
             )
       return(
            <div className="container">
                <div className="cart">
                    <h5>You have ordered:</h5>
                    <div className="shopping-cart">

                      <div className="column-labels">
                        <label className="product-image">Image</label>
                        <label className="product-details">Product</label>
                        <label className="product-price">Price</label>
                        <label className="product-quantity">Quantity</label>
                        <label className="product-removal">Remove</label>
                        <label className="product-line-price">Total</label>
                      </div>
                      </div>
                    <ul className="collection">
                        {addedItems}
                    </ul>
                </div> 
                {newTotal }     
            </div>
       )
    }
}


const mapStateToProps = (state)=>{
    return{
        items: state.items,
        //addedItems: state.addedItems
    }
}
const mapDispatchToProps = (dispatch)=>{
    return{
        removeItem: (id)=>{dispatch(removeItem(id))},
        addQuantity: (id)=>{dispatch(addQuantity(id))},
        subtractQuantity: (id)=>{dispatch(subtractQuantity(id))}
    }
}
export default connect(mapStateToProps,mapDispatchToProps)(Cart)
